  true,\n\t\"url\": null,\n\t\"notes\": \"Global Multihazard Proportional Economic
  Loss Risks is a 2.5 minute grid of a multihazard-based nneconomic loss risk as a
  proportion of the economic productivity of the analytical unit, the grid cell. Representation
  of multihazard nnrisk is not based on a multihazard index but rather on combinations
  of hazard risk categories, drought, seismic, and hydro. The nndrought category includes
  drought only. The seismic category consists of earthquake and volcano hazards. Cyclones,
  floods, and nnlandslides are included in the hydro category. For each of the six
  hazards considered, a binary risk surface is constructed utilizing nnthe three most-at-risk
  deciles of each hazard's global proportional economic loss risks dataset (deciles
  8-10). Each of the category nnrisk surfaces are constructed by adding all the relevant
  hazard high-risk surfaces. These categorical risk surfaces are reclassified nninto
  binary high-risk surfaces. The combination of the category risk values forms a three
  digit identifier for determining those nnlocations that are at higher-risk from
  multihazards. This dataset is the result of collaboration among the Columbia University
  Center nnfor Hazards and Risk Research (CHRR), International Bank for Reconstruction
  and Development/The World Bank, and Columbia University nnCenter for International
  Earth Science Information Network (CIESIN).\",\n\t\"license_title\": \"U.S. Government
